    console.log(props.myscore)
    return (
        <div className = "final-jeopardy">
            {props.myscore > 0 ?
            <div className = "made-it wager-stage">
            <div className = "my-score">{props.myscore}</div>
            <h2>Welcome to Final Jeopardy</h2>
            <h3>The category is <span class ="final-cat">{props.question.name}</span></h3>
